import React, { useState } from 'react';
import ModelSettings from './ModelSettings';
import APIKeyManagement from './APIKeyManagement';
import ChatbotStats from './ChatbotStats';
import ChatbotLogs from './ChatbotLogs';

const ChatbotManagement = () => {
    const [activeSection, setActiveSection] = useState('settings'); // settings, stats, logs
    const [modelType, setModelType] = useState('cloud'); // local, cloud
    const [selectedAPI, setSelectedAPI] = useState('openai');
    const [apiSettings, setApiSettings] = useState({
        chat: {
            model: 'gpt-4',
            temperature: 0.7,
            maxTokens: 2000,
            topP: 1,
            frequencyPenalty: 0,
            presencePenalty: 0
        },
        tts: {
            model: 'tts-1',
            voice: 'alloy',
            speed: 1.0,
            outputFormat: 'mp3'
        },
        stt: {
            model: 'whisper-1'
        },
        embedding: {
            model: 'text-embedding-3-small'
        },
        audioGeneration: {
            model: 'musicgen-1'
        }
    });

    return (
        <div className="hmk-manage-chatbot">
            <div className="hmk-manage-section-header">
                <h1>AI 챗봇 관리</h1>
                <div className="hmk-manage-header-actions">
                    <button 
                        className={`hmk-manage-tab ${activeSection === 'settings' ? 'active' : ''}`}
                        onClick={() => setActiveSection('settings')}
                    >
                        설정
                    </button>
                    <button 
                        className={`hmk-manage-tab ${activeSection === 'stats' ? 'active' : ''}`}
                        onClick={() => setActiveSection('stats')}
                    >
                        통계
                    </button>
                    <button 
                        className={`hmk-manage-tab ${activeSection === 'logs' ? 'active' : ''}`}
                        onClick={() => setActiveSection('logs')}
                    >
                        로그
                    </button>
                </div>
            </div>

            {activeSection === 'settings' && (
                <div className="hmk-manage-chatbot-settings">
                    <div className="hmk-manage-model-selection">
                        <h2>모델 선택</h2>
                        <div className="hmk-manage-radio-group">
                            <label>
                                <input
                                    type="radio"
                                    value="local"
                                    checked={modelType === 'local'}
                                    onChange={(e) => setModelType(e.target.value)}
                                />
                                로컬 LLM
                            </label>
                            <label>
                                <input
                                    type="radio"
                                    value="cloud"
                                    checked={modelType === 'cloud'}
                                    onChange={(e) => setModelType(e.target.value)}
                                />
                                클라우드 LLM
                            </label>
                        </div>

                        {modelType === 'cloud' && (
                            <>
                                <div className="hmk-manage-api-selection">
                                    <h3>API 제공자</h3>
                                    <select 
                                        value={selectedAPI}
                                        onChange={(e) => setSelectedAPI(e.target.value)}
                                    >
                                        <option value="openai">OpenAI</option>
                                        <option value="anthropic">Anthropic</option>
                                        <option value="google">Google AI</option>
                                    </select>
                                </div>
                                
                                <APIKeyManagement 
                                    selectedAPI={selectedAPI}
                                />

                                <ModelSettings 
                                    settings={apiSettings}
                                    onSettingsChange={setApiSettings}
                                    selectedAPI={selectedAPI}
                                />
                            </>
                        )}
                    </div>
                </div>
            )}

            {activeSection === 'stats' && <ChatbotStats />}
            {activeSection === 'logs' && <ChatbotLogs />}
        </div>
    );
};

export default ChatbotManagement;
